import React from 'react';

const ResetPassword = () => {
    return (
        <div>
            <div className="mycard">
                <div className="card auth-card input-field">
                    <h2></h2>
                    <input
                        type="text"
                        placeholder="email"

                    />
                    <button className="btn waves-effect waves-light #64b5f6 blue darken-1"

                    >
                        reset password
                    </button>


                </div>
            </div>
        </div>
    );
}

export default ResetPassword;
